import {
  GET_TAC_WETH_PAIR,
	UPDATE_TAC_WETH_PAIR,

} from '../constants/Uniswap';

export const getTacWethPair = (address) => {
  return {
    type: GET_TAC_WETH_PAIR,
    address
  }
};

export const updateTacWethPair = (payload) => {
  return {
    type: UPDATE_TAC_WETH_PAIR,
    payload
  }
};
